n","value":20},"x":{"field":"x"},"y":{"field":"y"}},"id":"21ff3612-8394-455e-a5a5-85e0cb16ad26","type":"Circle"},{"attributes":{"fill_alpha":{"value":0.5},"fill_color":{"value":"navy"},"line_alpha":{"value":0.5},"line_color":{"value":"navy"},"size":{"units":"screen","value":20},"x":{"field":"x"},"y":{"field":"y"}},"id":"74130663-762e-4050-b78f-8bc85f190dec","type":"Circle"},{"attributes":{"axis_label":"Plot","formatter":{"id":"4c8a0ce9-0d92-4fae-b494-68d8d28c1502","type":"BasicTickFormatter"},"plot":{"id":"77d8d3c1-2964-475f-bd50-1e7c7490041a","subtype":"Figure","type":"Plot"},"ticker":{"id":"d9ac2e50-4961-4c33-9050-667ade2f217a","type":"BasicTicker"}},"id":"05c8439f-a9e0-4ff1-9ab5-7592fce0f02b","type":"LinearAxis"},{"attributes":{"axis_label":"Plot","formatter":{"id":"98a2b3c0-5008-415a-8762-d3a0234d63d8","type":"BasicTickFormatter"},"plot":{"id":"26773ae0-ae2d-4512-9fd7-7360552f00f4","subtype":"Figure","type":"Plot"},"ticker":{"id":"136e1b07-367b-47c3-9550-1194118e2643","type":"BasicTicker"}},"id":"275e15d8-c15f-426a-b7bf-b82326023c94","type":"LinearAxis"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":20},"x":{"field":"x"},"y":{"field":"y"}},"id":"01d71150-1dd3-4fc9-8054-cf7a212761f3","type":"Circle"},{"attributes":{"axis_label":"Plot","formatter":{"id":"e55b88d5-7562-45e1-aea5-d11c8138dd77","type":"BasicTickFormatter"},"plot":{"id":"a40418be-2aba-4c27-9613-cca5554305da","subtype":"Figure","type":"Plot"},"ticker":{"id":"30a746ba-3829-4b94-9772-c4599dfdd686","type":"BasicTicker"}},"id":"e0c3ee07-ab7d-4a40-9027-e2357aec4e62","type":"LinearAxis"},{"attributes":{"data_source":{"id":"0ee7c145-45ab-434b-8234-99c233db4754","type":"ColumnDataSource"},"glyph":{"id":"21ff3612-8394-455e-a5a5-85e0cb16ad26","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"f738f287-c322-4193-9b1b-9e565a7f281f","type":"Circle"},"selection_glyph":null},"id":"093e903f-5c01-4735-b02b-be8e91635ae2","type":"GlyphRenderer"},{"attributes":{"callback":null,"column_names":["summary","x","y","x","y"],"data":{"summary1":["Dante said:<br><br>--O, if not, the eagles will come and pull out his eyes.--<br><br>    Pull out his eyes,<br>    Apologize,<br>    Apologize,<br>    Pull out his eyes.","He was standing on the field; his hand was pressed<br>to his side; his face was pale and strange and he wore the white cloak<br>of a marshal.","He knew that his father had paid a<br>guinea for it in Dunn's of D'Olier Street and that the man had prodded<br>it often at the breastbone to show how good it was: and he remembered<br>the man's voice when he had said:<br><br>--Take that one, sir.","Dante bent across the table and cried to Mr Casey:<br><br>--Right!","--Tomorrow and tomorrow and tomorrow, said the prefect of studies.","But the same foreknowledge which<br>had sickened his heart and made his legs sag suddenly as he raced round<br>the park, the same intuition which had made him glance with mistrust at<br>his trainer's flabby stubble-covered face as it bent heavily over his long<br>stained fingers, dissipated any vision of the future.","The confession came only from Stephen's lips and, while they spoke the<br>words, a sudden memory had carried him to another scene called up, as<br>if by magic, at the moment when he had noted the faint cruel dimples at<br>the corners of Heron's smiling lips and had felt the familiar stroke of<br>the cane against his calf and had heard the familiar word of<br>admonition:<br><br>--Admit.","They had set out early in the morning from Newcombe's coffee-house,<br>where Mr Dedalus's cup had rattled noisily against its saucer, and<br>Stephen had tried to cover that shameful sign of his father's drinking<br>bout of the night before by moving his chair and coughing.","A saint who has great power in<br>heaven, remember: power to intercede for us in our grief; power to<br>obtain whatever we pray for if it be for the good of our souls; power<br>above all to obtain for us the grace to repent if we be in sin.","In the last day of<br>terrible reckoning I pray fervently to God that not a single soul of<br>those who are in this chapel today may be found among those miserable<br>beings whom the Great Judge shall command to depart for ever from His<br>sight, that not one of us may ever hear ringing in his ears the awful<br>sentence of rejection: DEPART FROM ME, YE CURSED, INTO EVERLASTING FIRE<br>WHICH WAS PREPARED FOR THE DEVIL AND HIS ANGELS!","AND NOW THY VERY FACE AND<br>FORM, DEAR MOTHER SPEAK TO US OF THE ETERNAL NOT LIKE EARTHLY BEAUTY,<br>DANGEROUS TO LOOK UPON, BUT LIKE THE MORNING STAR WHICH IS THY EMBLEM,<br>BRIGHT AND MUSICAL, BREATHING PURITY, TELLING OF HEAVEN AND INFUSING<br>PEACE.","Then, almost at the instant of that touch, almost at<br>the verge of sinful consent, he found himself standing far away from<br>the flood upon a dry shore, saved by a sudden act of the will or a<br>sudden ejaculation; and, seeing the silver line of the flood far away<br>and beginning again its slow advance towards his feet, a new thrill of<br>power and satisfaction shook his soul to know that he had not yielded<br>nor undone all.","What were they now but cerements shaken from the body of death--the<br>fear he had walked in night and day, the incertitude that had ringed<br>him round, the shame that had abased him within and without--cerements,<br>the linens of the grave?","A smell of molten tallow came up from the dean's candle butts and fused<br>itself in Stephen's consciousness with the jingle of the words, bucket<br>and lamp and lamp and bucket.","Cranly, picking up the broken stave of a cask<br>from the grass at his feet, turned swiftly and said sternly:<br><br>--Temple, I declare to the living God if you say another word, do you<br>know, to anybody on any subject, I'll kill you SUPER SPOTTUM.","When we come to the phenomena of<br>artistic conception, artistic gestation, and artistic reproduction I<br>require a new terminology and a new personal experience.","Her nakedness yielded to him, radiant, warm,<br>odorous and lavish-limbed, enfolded him like a shining cloud, enfolded<br>him like water with a liquid life; and like a cloud of vapour or like<br>waters circumfluent in space the liquid letters of speech, symbols of<br>the element of mystery, flowed forth over his brain.","Temple stood up and, pushing past Cranly, addressed Glynn:<br><br>--That phrase you said now, he said, is from the new testament about<br>suffer the children to come to me.","--Yes, Stephen said, smiling in spite of himself at Cranly's way of<br>remembering thoughts in connexion with places.","The spell of arms and voices: the white arms of roads, their promise of<br>close embraces and the black arms of tall ships that stand against the<br>moon, their tale of distant nations."],"summary2":["One day a<br>fellow said to Cantwell:<br><br>--I'd give you such a belt in a second.","He wore the white cloak of a marshal; his face was pale<br>and strange; he held his hand pressed to his side.","But<br>Clongowes was far away: and the warm heavy smell of turkey and ham and<br>celery rose from the plates and dishes and the great fire was banked<br>high and red in the grate and the green ivy and red holly made you feel<br>so happy and when dinner was ended the big plum pudding would be<br>carried in, studded with peeled almonds and sprigs of holly, with<br>bluish fire running around it and a little green flag flying from the<br>top.","Mr Casey struggled<br>up from his chair and bent across the table towards her, scraping the<br>air from before his eyes with one hand as though he were tearing aside<br>a cobweb.","--He broke his glasses, said Father Arnall, and I exempted him from<br>work.","Stephen sometimes went<br>round with the car which delivered the evening milk and these chilly<br>drives blew away his memory of the filth of the cowyard and he felt no<br>repugnance at seeing the cow hairs and hayseeds on the milkman's coat.","The essay was for him the chief labour of his week and every Tuesday,<br>as he marched from home to the school, he read his fate in the<br>incidents of the way, pitting himself against some figure ahead of him<br>and quickening his pace to outstrip it before a certain goal was<br>reached or planting his steps scrupulously in the spaces of the<br>patchwork of the pathway and telling himself that he would be first and<br>not first in the weekly essay.","To the<br>sellers in the market, to the barmen and barmaids, to the beggars who<br>importuned him for a lob Mr Dedalus told the same tale--that he was an<br>old Corkonian, that he had been trying for thirty years to get rid of<br>his Cork accent up in Dublin and that Peter Pickackafax beside him was<br>his eldest son but that he was only a Dublin jackeen.","He<br>clasped his hands on the desk and said:<br><br>--The retreat will begin on Wednesday afternoon in honour of saint<br>Francis Xavier whose feast day is Saturday.","Time was to sin in secrecy, to indulge in that sloth and pride, to<br>covet the unlawful, to yield to the promptings of your lower nature, to<br>live like the beasts of the field, nay worse than the beasts of the<br>field, for they, at least, are but brutes and have no reason to guide<br>them: time was, but time shall be no more.","When evening had fallen he left the house, and the first touch of the<br>damp dark air and the noise of the door as it closed behind him made<br>ache again his conscience, lulled by prayer and tears.","Ever since the message of summons had come<br>for him from the director his mind had struggled to find the meaning of<br>the message; and, during the long restless time he had sat in the<br>college parlour waiting for the director to come in, his eyes had<br>wandered from one sober picture to another around the walls and his<br>mind wandered from one guess to another until the meaning of the<br>summons had almost become clear.","Here and there warm isles of<br>sand gleamed above the shallow tide and about the isles and around the<br>long bank and amid the shallow currents of the beach were lightclad<br>figures, wading and delving.","--He tells us in his homely way, the dean went on, that he put an iron<br>lamp before a statue of one of the gods and that a thief stole the<br>lamp.","Temple bent again across Cranly, as they were passing through the<br>doorway, and said in a swift whisper:<br><br>--Do you know that he is a married man?","--It amuses me vastly, he said, to hear you quoting him time after<br>time like a jolly round friar.","Then first her soul<br>had begun to live as his soul had when he had first sinned, and a<br>tender compassion filled his heart as he remembered her frail pallor<br>and her eyes, humbled and saddened by the dark shame of womanhood.","The squat student did not eat it but, indulging his special humour,<br>said gravely, still tittering and prodding his phrase with his<br>umbrella:<br><br>--Do you intend that...?","--You wish me to say, Stephen answered, that the rights of property<br>are provisional, and that in certain circumstances it is not unlawful<br>to rob.","Then, in that case, all the rest, all<br>that I thought I thought and all that I felt I felt, all the rest<br>before now, in fact... O, give it up, old chap!"],"summary3":["And when Stephen had not been able to answer Nasty Roche had asked:<br><br>--What is your father?","They looked at him and saw their<br>master's face and cloak and knew that he had received his death-wound.","Mr Dedalus went to the end of the table and said:<br><br>--Now, Mrs Riordan, sit over.","At the door Dante turned round violently<br>and shouted down the room, her cheeks flushed and quivering with rage:<br><br>--Devil out of hell!","--Tomorrow, sir, said Tom Furlong's voice.","Whenever the car drew up before a house he waited to catch a glimpse of<br>a well scrubbed kitchen or of a softly lighted hall and to see how the<br>servant would hold the jug and how she would close the door.","It was a submission and Mr Tate, appeased, folded up the essay and<br>passed it across to him, saying:<br><br>--O...Ah!","Then he had been sent<br>away from home to a college, he had made his first communion and eaten<br>slim jim out of his cricket cap and watched the firelight leaping and<br>dancing on the wall of a little bedroom in the infirmary and dreamed of<br>being dead, of mass being said for him by the rector in a black and<br>gold cope, of being buried then in the little graveyard of the<br>community off the main avenue of limes.","The rector went on gravely:<br><br>--You are all familiar with the story of the life of saint Francis<br>Xavier, I suppose, the patron of your college.","You would not crush out that pride and<br>anger in your heart, you would not restore those ill-gotten goods, you<br>would not obey the precepts of your holy church nor attend to your<br>religious duties, you would not abandon those wicked companions, you<br>would not avoid those dangerous temptations.","Heaven was still and faintly luminous and the<br>air sweet to breathe, as in a thicket drenched with showers; and amid<br>peace and shimmering lights and quiet fragrance he made a covenant with<br>his heart.","An inaudible voice seemed to caress the<br>soul, telling her names and glories, bidding her arise as for espousal<br>and come away, bidding her look forth, a spouse, from Amana and from<br>the mountains of the leopards; and the soul seemed to answer with the<br>same inaudible voice, surrendering herself: INTER UBERA MEA<br>COMMORABITUR.","His soul was soaring in<br>an air beyond the world and the body he knew was purified in a breath<br>and delivered of incertitude and made radiant and commingled with the<br>element of the spirit.","--One difficulty, said Stephen, in esthetic discussion is to know<br>whether words are being used according to the literary tradition or<br>according to the tradition of the marketplace.","Temple wriggled in his grip, laughing still with sly content, while<br>Cranly repeated flatly at every rude shake:<br><br>--A flaming flaring bloody idiot!","Lynch began to sing softly and solemnly in a deep bass voice:<br><br>    IMPLETA SUNT QUAE CONCINIT<br>    DAVID FIDELI CARMINE<br>    DICENDO NATIONIBUS<br>    REGNAVIT A LIGNO DEUS.","A sense of her innocence<br>moved him almost to pity her, an innocence he had never understood till<br>he had come to the knowledge of it through sin, an innocence which she<br>too had not understood while she was innocent or before the strange<br>humiliation of her nature had first come upon her.","--Um, Cranly answered, holding out what remained of the half chewed<br>fig and jerking it towards the squat student's mouth in sign that he<br>should eat.","--Because, Cranly continued, you need not look upon yourself as driven<br>away if you do not wish to go or as a heretic or an outlaw.","Welcome, O life, I go to encounter for the millionth time the reality<br>of experience and to forge in the smithy of my soul the uncreated<br>conscience of my race."],"x":{"__ndarray__":"AAAAAAAAAAAAAAAAAAAYQAAAAAAAACZAAAAAAAAAMEAAAAAAAAA2QAAAAAAAADtAAAAAAAAAQEAAAAAAAIBCQAAAAAAAgEVAAAAAAAAASEAAAAAAAIBKQAAAAAAAAE1AAAAAAAAAUEAAAAAAAEBRQAAAAAAAgFJAAAAAAADAU0AAAAAAAEBVQAAAAAAAgFZAAAAAAADAV0AAAAAAAABZQA==","dtype":"float64","shape":[20]},"y":{"__ndarray__":"BWA+cVckiD8i0QfMt9+sP2pggDJUI6A/yBVMLEnknr/7cCDI/jyivw94ILstr6Q/w5vbDtbHuD8EafrHuV6pPzEyUeOt/7a/PGujJ++swb83fx93z0Gzvze3omG1k5g/4ZpW/49asT8it3Ju9tqnP4GaxC70VqM/yQXu0wmGrD/tKaa+AJaqPyuhcfrmUIQ/TnkvaGNGkL+A7GnTm8iHPw==","dtype":"float64","shape":[20]}}},"id":"0ee7c145-45ab-434b-8234-99c233db4754","type":"ColumnDataSource"},{"attributes":{},"id":"4c8a0ce9-0d92-4fae-b494-68d8d28c1502","type":"BasicTickFormatter"},{"attributes":{"callback":null},"id":"254fc0b9-0797-4b71-bedd-b90d351821e4","type":"DataRange1d"},{"attributes":{"data_source":{"id":"879682ae-8df1-4c74-a4e3-bf033449ce7c","type": yes.","He was standing on the field; his hand was pressed<br>to his side; his face was pale and strange and he wore the white cloak<br>of a marshal.","He knew that his father had paid a<br>guinea for it in Dunn's of D'Olier Street and that the man had prodded<br>it often at the breastbone to show how good it was: and he remembered<br>the man's voice when he had said:<br><br>--Take that one, sir.","Dante bent across the table and cried to Mr Casey:<br><br>--Right!","--Tomorrow and tomorrow and tomorrow, said the prefect of studies.","But the same foreknowledge which<br>had sickened his heart and made his legs sag suddenly as he raced round<br>the park, the same intuition which had made him glance with mistrust at<br>his trainer's flabby stubble-covered face as it bent heavily over his long<br>stained fingers, dissipated any vision of the future.","The confession came only from Stephen's lips and, while they spoke the<br>words, a sudden memory had carried him to another scene called up, as<br>if by magic, at the moment when he had noted the faint cruel dimples at<br>the corners of Heron's smiling lips and had felt the familiar stroke of<br>the cane against his calf and had heard the familiar word of<br>admonition:<br><br>--Admit.","They had set out early in the morning from Newcombe's coffee-house,<br>where Mr Dedalus's cup had rattled noisily against its saucer, and<br>Stephen had tried to cover that shameful sign of his father's drinking<br>bout of the night before by moving his chair and coughing.","A saint who has great power in<br>heaven, remember: power to intercede for us in our grief; power to<br>obtain whatever we pray for if it be for the good of our souls; power<br>above all to obtain for us the grace to repent if we be in sin.","In the last day of<br>terrible reckoning I pray fervently to God that not a single soul of<br>those who are in this chapel today may be found among those miserable<br>beings whom the Great Judge shall command to depart for ever from His<br>sight, that not one of us may ever hear ringing in his ears the awful<br>sentence of rejection: DEPART FROM ME, YE CURSED, INTO EVERLASTING FIRE<br>WHICH WAS PREPARED FOR THE DEVIL AND HIS ANGELS!","AND NOW THY VERY FACE AND<br>FORM, DEAR MOTHER SPEAK TO US OF THE ETERNAL NOT LIKE EARTHLY BEAUTY,<br>DANGEROUS TO LOOK UPON, BUT LIKE THE MORNING STAR WHICH IS THY EMBLEM,<br>BRIGHT AND MUSICAL, BREATHING PURITY, TELLING OF HEAVEN AND INFUSING<br>PEACE.","Then, almost at the instant of that touch, almost at<br>the verge of sinful consent, he found himself standing far away from<br>the flood upon a dry shore, saved by a sudden act of the will or a<br>sudden ejaculation; and, seeing the silver line of the flood far away<br>and beginning again its slow advance towards his feet, a new thrill of<br>power and satisfaction shook his soul to know that he had not yielded<br>nor undone all.","What were they now but cerements shaken from the body of death--the<br>fear he had walked in night and day, the incertitude that had ringed<br>him round, the shame that had abased him within and without--cerements,<br>the linens of the grave?","A smell of molten tallow came up from the dean's candle butts and fused<br>itself in Stephen's consciousness with the jingle of the words, bucket<br>and lamp and lamp and bucket.","Cranly, picking up the broken stave of a cask<br>from the grass at his feet, turned swiftly and said sternly:<br><br>--Temple, I declare to the living God if you say another word, do you<br>know, to anybody on any subject, I'll kill you SUPER SPOTTUM.","When we come to the phenomena of<br>artistic conception, artistic gestation, and artistic reproduction I<br>require a new terminology and a new personal experience.","Her nakedness yielded to him, radiant, warm,<br>odorous and lavish-limbed, enfolded him like a shining cloud, enfolded<br>him like water with a liquid life; and like a cloud of vapour or like<br>waters circumfluent in space the liquid letters of speech, symbols of<br>the element of mystery, flowed forth over his brain.","Temple stood up and, pushing past Cranly, addressed Glynn:<br><br>--That phrase you said now, he said, is from the new testament about<br>suffer the children to come to me.","--Yes, Stephen said, smiling in spite of himself at Cranly's way of<br>remembering thoughts in connexion with places.","The spell of arms and voices: the white arms of roads, their promise of<br>close embraces and the black arms of tall ships that stand against the<br>moon, their tale of distant nations."],"summary2":["One day a<br>fellow said to Cantwell:<br><br>--I'd give you such a belt in a second.","He wore the white cloak of a marshal; his face was pale<br>and strange; he held his hand pressed to his side.","But<br>Clongowes was far away: and the warm heavy smell of turkey and ham and<br>celery rose from the plates and dishes and the great fire was banked<br>high and red in the grate and the green ivy and red holly made you feel<br>so happy and when dinner was ended the big plum pudding would be<br>carried in, studded with peeled almonds and sprigs of holly, with<br>bluish fire running around it and a little green flag flying from the<br>top.","Mr Casey struggled<br>up from his chair and bent across the table towards her, scraping the<br>air from before his eyes with one hand as though he were tearing aside<br>a cobweb.","--He broke his glasses, said Father Arnall, and I exempted him from<br>work.","Stephen sometimes went<br>round with the car which delivered the evening milk and these chilly<br>drives blew away his memory of the filth of the cowyard and he felt no<br>repugnance at seeing the cow hairs and hayseeds on the milkman's coat.","The essay was for him the chief labour of his week and every Tuesday,<br>as he marched from home to the school, he read his fate in the<br>incidents of the way, pitting himself against some figure ahead of him<br>and quickening his pace to outstrip it before a certain goal was<br>reached or planting his steps scrupulously in the spaces of the<br>patchwork of the pathway and telling himself that he would be first and<br>not first in the weekly essay.","To the<br>sellers in the market, to the barmen and barmaids, to the beggars who<br>importuned him for a lob Mr Dedalus told the same tale--that he was an<br>old Corkonian, that he had been trying for thirty years to get rid of<br>his Cork accent up in Dublin and that Peter Pickackafax beside him was<br>his eldest son but that he was only a Dublin jackeen.","He<br>clasped his hands on the desk and said:<br><br>--The retreat will begin on Wednesday afternoon in honour of saint<br>Francis Xavier whose feast day is Saturday.","Time was to sin in secrecy, to indulge in that sloth and pride, to<br>covet the unlawful, to yield to the promptings of your lower nature, to<br>live like the beasts of the field, nay worse than the beasts of the<br>field, for they, at least, are but brutes and have no reason to guide<br>them: time was, but time shall be no more.","When evening had fallen he left the house, and the first touch of the<br>damp dark air and the noise of the door as it closed behind him made<br>ache again his conscience, lulled by prayer and tears.","Ever since the message of summons had come<br>for him from the director his mind had struggled to find the meaning of<br>the message; and, during the long restless time he had sat in the<br>college parlour waiting for the director to come in, his eyes had<br>wandered from one sober picture to another around the walls and his<br>mind wandered from one guess to another until the meaning of the<br>summons had almost become clear.","Here and there warm isles of<br>sand gleamed above the shallow tide and about the isles and around the<br>long bank and amid the shallow currents of the beach were lightclad<br>figures, wading and delving.","--He tells us in his homely way, the dean went on, that he put an iron<br>lamp before a statue of one of the gods and that a thief stole the<br>lamp.","Temple bent again across Cranly, as they were passing through the<br>doorway, and said in a swift whisper:<br><br>--Do you know that he is a married man?","--It amuses me vastly, he said, to hear you quoting him time after<br>time like a jolly round friar.","Then first her soul<br>had begun to live as his soul had when he had first sinned, and a<br>tender compassion filled his heart as he remembered her frail pallor<br>and her eyes, humbled and saddened by the dark shame of womanhood.","The squat student did not eat it but, indulging his special humour,<br>said gravely, still tittering and prodding his phrase with his<br>umbrella:<br><br>--Do you intend that...?","--You wish me to say, Stephen answered, that the rights of property<br>are provisional, and that in certain circumstances it is not unlawful<br>to rob.","Then, in that case, all the rest, all<br>that I thought I thought and all that I felt I felt, all the rest<br>before now, in fact... O, give it up, old chap!"],"summary3":["And when Stephen had not been able to answer Nasty Roche had asked:<br><br>--What is your father?","They looked at him and saw their<br>master's face and cloak and knew that he had received his death-wound.","Mr Dedalus went to the end of the table and said:<br><br>--Now, Mrs Riordan, sit over.","At the door Dante turned round violently<br>and shouted down the room, her cheeks flushed and quivering with rage:<br><br>--Devil out of hell!","--Tomorrow, sir, said Tom Furlong's voice.","Whenever the car drew up before a house he waited to catch a glimpse of<br>a well scrubbed kitchen or of a softly lighted hall and to see how the<br>servant would hold the jug and how she would close the door.","It was a submission and Mr Tate, appeased, folded up the essay and<br>passed it across to him, saying:<br><br>--O...Ah!","Then he had been sent<br>away from home to a college, he had made his first communion and eaten<br>slim jim out of his cricket cap and watched the firelight leaping and<br>dancing on the wall of a little bedroom in the infirmary and dreamed of<br>being dead, of mass being said for him by the rector in a black and<br>gold cope, of being buried then in the little graveyard of the<br>community off the main avenue of limes.","The rector went on gravely:<br><br>--You are all familiar with the story of the life of saint Francis<br>Xavier, I suppose, the patron of your college.","You would not crush out that pride and<br>anger in your heart, you would not restore those ill-gotten goods, you<br>would not obey the precepts of your holy church nor attend to your<br>religious duties, you would not abandon those wicked companions, you<br>would not avoid those dangerous temptations.","Heaven was still and faintly luminous and the<br>air sweet to breathe, as in a thicket drenched with showers; and amid<br>peace and shimmering lights and quiet fragrance he made a covenant with<br>his heart.","An inaudible voice seemed to caress the<br>soul, telling her names and glories, bidding her arise as for espousal<br>and come away, bidding her look forth, a spouse, from Amana and from<br>the mountains of the leopards; and the soul seemed to answer with the<br>same inaudible voice, surrendering herself: INTER UBERA MEA<br>COMMORABITUR.","His soul was soaring in<br>an air beyond the world and the body he knew was purified in a breath<br>and delivered of incertitude and made radiant and commingled with the<br>element of the spirit.","--One difficulty, said Stephen, in esthetic discussion is to know<br>whether words are being used according to the literary tradition or<br>according to the tradition of the marketplace.","Temple wriggled in his grip, laughing still with sly content, while<br>Cranly repeated flatly at every rude shake:<br><br>--A flaming flaring bloody idiot!","Lynch began to sing softly and solemnly in a deep bass voice:<br><br>    IMPLETA SUNT QUAE CONCINIT<br>    DAVID FIDELI CARMINE<br>    DICENDO NATIONIBUS<br>    REGNAVIT A LIGNO DEUS.","A sense of her innocence<br>moved him almost to pity her, an innocence he had never understood till<br>he had come to the knowledge of it through sin, an innocence which she<br>too had not understood while she was innocent or before the strange<br>humiliation of her nature had first come upon her.","--Um, Cranly answered, holding out what remained of the half chewed<br>fig and jerking it towards the squat student's mouth in sign that he<br>should eat.","--Because, Cranly continued, you need not look upon yourself as driven<br>away if you do not wish to go or as a heretic or an outlaw.","Welcome, O life, I go to encounter for the millionth time the reality<br>of experience and to forge in the smithy of my soul the uncreated<br>conscience of my race."],"x":{"__ndarray__":"AAAAAAAAAAAAAAAAAAAYQAAAAAAAACZAAAAAAAAAMEAAAAAAAAA2QAAAAAAAADtAAAAAAAAAQEAAAAAAAIBCQAAAAAAAgEVAAAAAAAAASEAAAAAAAIBKQAAAAAAAAE1AAAAAAAAAUEAAAAAAAEBRQAAAAAAAgFJAAAAAAADAU0AAAAAAAEBVQAAAAAAAgFZAAAAAAADAV0AAAAAAAABZQA==","dtype":"float64","shape":[20]},"y":{"__ndarray__":"BWA+cVckiD8i0QfMt9+sP2pggDJUI6A/yBVMLEnknr/7cCDI/jyivw94ILstr6Q/w5vbDtbHuD8EafrHuV6pPzEyUeOt/7a/PGujJ++swb83fx93z0Gzvze3omG1k5g/4ZpW/49asT8it3Ju9tqnP4GaxC70VqM/yQXu0wmGrD/tKaa+AJaqPyuhcfrmUIQ/TnkvaGNGkL+A7GnTm8iHPw==","dtype":"float64","shape":[20]}}},"id":"097a95e9-a8a9-4944-861f-adba06cbf276","type":"ColumnDataSource"},{"attributes":{},"id":"68f068b8-acbb-479e-99f8-ae007056ecda","type":"BasicTickFormatter"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"line_width":{"value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"c8fe6421-dd29-4aab-96e0-a51eed3f6563","type":"Line"},{"attributes":{"line_color":{"value":"#1f77b4"},"line_width":{"value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"244c12a1-db52-4586-96fb-5a31b886f9b2","type":"Line"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":" 434315305a5","type":"Toolbar"},"toolbar_location":"below","x_range":{"id":"d81ead5b-8900-4733-af35-4fa008fb8339","type":"DataRange1d"},"y_range":{"id":"e73527db-1258-405a-937b-706257d6443c","type":"DataRange1d"}},"id":"77d8d3c1-2964-475f-bd50-1e7c7490041a","subtype":"Figure","type":"Plot"},{"attributes":{"callback":null},"id":"e73527db-1258-405a-937b-706257d6443c","type":"DataRange1d"},{"attributes":{"callback":null,"column_names":["summary","x","y","x","y"],"data":{"summary1":["Dante said:<br><br>--O, if not, the eagles will come and pull out his eyes.--<br><br>    Pull out his eyes,<br>    Apologize,<br>    Apologize,<br>    Pull out his eyes.","He was standing on the field; his hand was pressed<br>to his side; his face was pale and strange and he wore the white cloak<br>of a marshal.","He knew that his father had paid a<br>guinea for it in Dunn's of D'Olier Street and that the man had prodded<br>it often at the breastbone to show how good it was: and he remembered<br>the man's voice when he had said:<br><br>--Take that one, sir.","Dante bent across the table and cried to Mr Casey:<br><br>--Right!","--Tomorrow and tomorrow and tomorrow, said the prefect of studies.","But the same foreknowledge which<br>had sickened his heart and made his legs sag suddenly as he raced round<br>the park, the same intuition which had made him glance with mistrust at<br>his trainer's flabby stubble-covered face as it bent heavily over his long<br>stained fingers, dissipated any vision of the future.","The confession came only from Stephen's lips and, while they spoke the<br>words, a sudden memory had carried him to another scene called up, as<br>if by magic, at the moment when he had noted the faint cruel dimples at<br>the corners of Heron's smiling lips and had felt the familiar stroke of<br>the cane against his calf and had heard the familiar word of<br>admonition:<br><br>--Admit.","They had set out early in the morning from Newcombe's coffee-house,<br>where Mr Dedalus's cup had rattled noisily against its saucer, and<br>Stephen had tried to cover that shameful sign of his father's drinking<br>bout of the night before by moving his chair and coughing.","A saint who has great power in<br>heaven, remember: power to intercede for us in our grief; power to<br>obtain whatever we pray for if it be for the good of our souls; power<br>above all to obtain for us the grace to repent if we be in sin.","In the last day of<br>terrible reckoning I pray fervently to God that not a single soul of<br>those who are in this chapel today may be found among those miserable<br>beings whom the Great Judge shall command to depart for ever from His<br>sight, that not one of us may ever hear ringing in his ears the awful<br>sentence of rejection: DEPART FROM ME, YE CURSED, INTO EVERLASTING FIRE<br>WHICH WAS PREPARED FOR THE DEVIL AND HIS ANGELS!","AND NOW THY VERY FACE AND<br>FORM, DEAR MOTHER SPEAK TO US OF THE ETERNAL NOT LIKE EARTHLY BEAUTY,<br>DANGEROUS TO LOOK UPON, BUT LIKE THE MORNING STAR WHICH IS THY EMBLEM,<br>BRIGHT AND MUSICAL, BREATHING PURITY, TELLING OF HEAVEN AND INFUSING<br>PEACE.","Then, almost at the instant of that touch, almost at<br>the verge of sinful consent, he found himself standing far away from<br>the flood upon a dry shore, saved by a sudden act of the will or a<br>sudden ejaculation; and, seeing the silver line of the flood far away<br>and beginning again its slow advance towards his feet, a new thrill of<br>power and satisfaction shook his soul to know that he had not yielded<br>nor undone all.","What were they now but cerements shaken from the body of death--the<br>fear he had walked in night and day, the incertitude that had ringed<br>him round, the shame that had abased him within and without--cerements,<br>the linens of the grave?","A smell of molten tallow came up from the dean's candle butts and fused<br>itself in Stephen's consciousness with the jingle of the words, bucket<br>and lamp and lamp and bucket.","Cranly, picking up the broken stave of a cask<br>from the grass at his feet, turned swiftly and said sternly:<br><br>--Temple, I declare to the living God if you say another word, do you<br>know, to anybody on any subject, I'll kill you SUPER SPOTTUM.","When we come to the phenomena of<br>artistic conception, artistic gestation, and artistic reproduction I<br>require a new terminology and a new personal experience.","Her nakedness yielded to him, radiant, warm,<br>odorous and lavish-limbed, enfolded him like a shining cloud, enfolded<br>him like water with a liquid life; and like a cloud of vapour or like<br>waters circumfluent in space the liquid letters of speech, symbols of<br>the element of mystery, flowed forth over his brain.","Temple stood up and, pushing past Cranly, addressed Glynn:<br><br>--That phrase you said now, he said, is from the new testament about<br>suffer the children to come to me.","--Yes, Stephen said, smiling in spite of himself at Cranly's way of<br>remembering thoughts in connexion with places.","The spell of arms and voices: the white arms of roads, their promise of<br>close embraces and the black arms of tall ships that stand against the<br>moon, their tale of distant nations."],"summary2":["One day a<br>fellow said to Cantwell:<br><br>--I'd give you such a belt in a second.","He wore the white cloak of a marshal; his face was pale<br>and strange; he held his hand pressed to his side.","But<br>Clongowes was far away: and the warm heavy smell of turkey and ham and<br>celery rose from the plates and dishes and the great fire was banked<br>high and red in the grate and the green ivy and red holly made you feel<br>so happy and when dinner was ended the big plum pudding would be<br>carried in, studded with peeled almonds and sprigs of holly, with<br>bluish fire running around it and a little green flag flying from the<br>top.","Mr Casey struggled<br>up from his chair and bent across the table towards her, scraping the<br>air from before his eyes with one hand as though he were tearing aside<br>a cobweb.","--He broke his glasses, said Father Arnall, and I exempted him from<br>work.","Stephen sometimes went<br>round with the car which delivered the evening milk and these chilly<br>drives blew away his memory of the filth of the cowyard and he felt no<br>repugnance at seeing the cow hairs and hayseeds on the milkman's coat.","The essay was for him the chief labour of his week and every Tuesday,<br>as he marched from home to the school, he read his fate in the<br>incidents of the way, pitting himself against some figure ahead of him<br>and quickening his pace to outstrip it before a certain goal was<br>reached or planting his steps scrupulously in the spaces of the<br>patchwork of the pathway and telling himself that he would be first and<br>not first in the weekly essay.","To the<br>sellers in the market, to the barmen and barmaids, to the beggars who<br>importuned him for a lob Mr Dedalus told the same tale--that he was an<br>old Corkonian, that he had been trying for thirty years to get rid of<br>his Cork accent up in Dublin and that Peter Pickackafax beside him was<br>his eldest son but that he was only a Dublin jackeen.","He<br>clasped his hands on the desk and said:<br><br>--The retreat will begin on Wednesday afternoon in honour of saint<br>Francis Xavier whose feast day is Saturday.","Time was to sin in secrecy, to indulge in that sloth and pride, to<br>covet the unlawful, to yield to the promptings of your lower nature, to<br>live like the beasts of the field, nay worse than the beasts of the<br>field, for they, at least, are but brutes and have no reason to guide<br>them: time was, but time shall be no more.","When evening had fallen he left the house, and the first touch of the<br>damp dark air and the noise of the door as it closed behind him made<br>ache again his conscience, lulled by prayer and tears.","Ever since the message of summons had come<br>for him from the director his mind had struggled to find the meaning of<br>the message; and, during the long restless time he had sat in the<br>college parlour waiting for the director to come in, his eyes had<br>wandered from one sober picture to another around the walls and his<br>mind wandered from one guess to another until the meaning of the<br>summons had almost become clear.","Here and there warm isles of<br>sand gleamed above the shallow tide and about the isles and around the<br>long bank and amid the shallow currents of the beach were lightclad<br>figures, wading and delving.","--He tells us in his homely way, the dean went on, that he put an iron<br>lamp before a statue of one of the gods and that a thief stole the<br>lamp.","Temple bent again across Cranly, as they were passing through the<br>doorway, and said in a swift whisper:<br><br>--Do you know that he is a married man?","--It amuses me vastly, he said, to hear you quoting him time after<br>time like a jolly round friar.","Then first her soul<br>had begun to live as his soul had when he had first sinned, and a<br>tender compassion filled his heart as he remembered her frail pallor<br>and her eyes, humbled and saddened by the dark shame of womanhood.","The squat student did not eat it but, indulging his special humour,<br>said gravely, still tittering and prodding his phrase with his<br>umbrella:<br><br>--Do you intend that...?","--You wish me to say, Stephen answered, that the rights of property<br>are provisional, and that in certain circumstances it is not unlawful<br>to rob.","Then, in that case, all the rest, all<br>that I thought I thought and all that I felt I felt, all the rest<br>before now, in fact... O, give it up, old chap!"],"summary3":["And when Stephen had not been able to answer Nasty Roche had asked:<br><br>--What is your father?","They looked at him and saw their<br>master's face and cloak and knew that he had received his death-wound.","Mr Dedalus went to the end of the table and said:<br><br>--Now, Mrs Riordan, sit over.","At the door Dante turned round violently<br>and shouted down the room, her cheeks flushed and quivering with rage:<br><br>--Devil out of hell!","--Tomorrow, sir, said Tom Furlong's voice.","Whenever the car drew up before a house he waited to catch a glimpse of<br>a well scrubbed kitchen or of a softly lighted hall and to see how the<br>servant would hold the jug and how she would close the door.","It was a submission and Mr Tate, appeased, folded up the essay and<br>passed it across to him, saying:<br><br>--O...Ah!","Then he had been sent<br>away from home to a college, he had made his first communion and eaten<br>slim jim out of his cricket cap and watched the firelight leaping and<br>dancing on the wall of a little bedroom in the infirmary and dreamed of<br>being dead, of mass being said for him by the rector in a black and<br>gold cope, of being buried then in the little graveyard of the<br>community off the main avenue of limes.","The rector went on gravely:<br><br>--You are all familiar with the story of the life of saint Francis<br>Xavier, I suppose, the patron of your college.","You would not crush out that pride and<br>anger in your heart, you would not restore those ill-gotten goods, you<br>would not obey the precepts of your holy church nor attend to your<br>religious duties, you would not abandon those wicked companions, you<br>would not avoid those dangerous temptations.","Heaven was still and faintly luminous and the<br>air sweet to breathe, as in a thicket drenched with showers; and amid<br>peace and shimmering lights and quiet fragrance he made a covenant with<br>his heart.","An inaudible voice seemed to caress the<br>soul, telling her names and glories, bidding her arise as for espousal<br>and come away, bidding her look forth, a spouse, from Amana and from<br>the mountains of the leopards; and the soul seemed to answer with the<br>same inaudible voice, surrendering herself: INTER UBERA MEA<br>COMMORABITUR.","His soul was soaring in<br>an air beyond the world and the body he knew was purified in a breath<br>and delivered of incertitude and made radiant and commingled with the<br>element of the spirit.","--One difficulty, said Stephen, in esthetic discussion is to know<br>whether words are being used according to the literary tradition or<br>according to the tradition of the marketplace.","Temple wriggled in his grip, laughing still with sly content, while<br>Cranly repeated flatly at every rude shake:<br><br>--A flaming flaring bloody idiot!","Lynch began to sing softly and solemnly in a deep bass voice:<br><br>    IMPLETA SUNT QUAE CONCINIT<br>    DAVID FIDELI CARMINE<br>    DICENDO NATIONIBUS<br>    REGNAVIT A LIGNO DEUS.","A sense of her innocence<br>moved him almost to pity her, an innocence he had never understood till<br>he had come to the knowledge of it through sin, an innocence which she<br>too had not understood while she was innocent or before the strange<br>humiliation of her nature had first come upon her.","--Um, Cranly answered, holding out what remained of the half chewed<br>fig and jerking it towards the squat student's mouth in sign that he<br>should eat.","--Because, Cranly continued, you need not look upon yourself as driven<br>away if you do not wish to go or as a heretic or an outlaw.","Welcome, O life, I go to encounter for the millionth time the reality<br>of experience and to forge in the smithy of my soul the uncreated<br>conscience of my race."],"x":{"__ndarray__":"AAAAAAAAAAAAAAAAAAAYQAAAAAAAACZAAAAAAAAAMEAAAAAAAAA2QAAAAAAAADtAAAAAAAAAQEAAAAAAAIBCQAAAAAAAgEVAAAAAAAAASEAAAAAAAIBKQAAAAAAAAE1AAAAAAAAAUEAAAAAAAEBRQAAAAAAAgFJAAAAAAADAU0AAAAAAAEBVQAAAAAAAgFZAAAAAAADAV0AAAAAAAABZQA==","dtype":"float64","shape":[20]},"y":{"__ndarray__":"BWA+cVckiD8i0QfMt9+sP2pggDJUI6A/yBVMLEnknr/7cCDI/jyivw94ILstr6Q/w5vbDtbHuD8EafrHuV6pPzEyUeOt/7a/PGujJ++swb83fx93z0Gzvze3omG1k5g/4ZpW/49asT8it3Ju9tqnP4GaxC70VqM/yQXu0wmGrD/tKaa+AJaqPyuhcfrmUIQ/TnkvaGNGkL+A7GnTm8iHPw==","dtype":"float64","shape":[20]}}},"id":"532c1661-a266-4442-b532
